<html>
  <head>
    <title>Make Your Own Blotch Logo</title>
  </head>
  <body>
    <div id="mainContainer">
      <h2>Stroke Version</h2>
      <a href="/2"><strong>(Change to Fill Version)</strong></a>
      <form>
        <p>
          Scatter
          <input type="range" name="scatter" id="scatter" min="0.0" max="15.0" value="3.0" step="0.5">
        </p>
        <p>
          Radius Minimum
          <input type="range" name="radminimum" id="radminimum" min="0.0" max="10.0" value="0.25" step="0.05">
        </p>
        <p>
          Radius Maximum
          <input type="range" name="radmaximum" id="radmaximum" min="0.0" max="10.0" value="0.75" step="0.05">
        </p>
        <p>
          Speed
          <input type="range" name="speedvalue" id="speedvalue" min="100" max="3000" value="2000" step="50">
        </p>
        <p>
          Change Color
          <input type="checkbox" name="colorRand" id="colorRand">
        </p>
      </form>
      <p>
        <a href="/">Reset</a>
        <span> | </span>
        <a id="pauseAnim" href="#">Pause</a>
        <span> | </span>
        <a id="playAnim" href="#">Play</a>
      </p>
    </div>
